import FeeCalculator from "./FeeCalculator";

class ServiceFeeDecorator extends ServiceFeeCalculator {
    calculate(price) {
        return price * 0.1;
    }
    calculateInsure(price) {
        return price * 0.05;
    }
}

export default ServiceFeeDecorator;
